#include<bits/stdc++.h>
using namespace std;
class Solution {
public:
    string largestOddNumber(string num) {
        ios_base::sync_with_stdio(false);
        cin.tie(0);
        int i=num.length()-1;
        while(i>=0){
            int x=num[i]-'0';
            if(x%2!=0) return num.substr(0,i+1);
            i--;
        }
        return "";
    }
};
int main(){
    string num="";
    Solution obj;
    string result=obj.largestOddNumber(num);
    cout<<"Result : "<<result<<endl;
}